// Filename - array.js
// Javascript object named array with 3 key-values
const array = [
	{
		id: 'NO999',
		namaBarang: 'Sabun Colek',
		hargaBeli: 5_000,
		hargaJual:5_500,
		stok:999
	}
]

export default array
